    interval: 300
    timeout: 5000
    tolerance: 100
    url: https://www.google.com/gen_204
    include-all: true

  - name: ⚖️ 负载均衡-轮询
    type: load-balance
    strategy: round-robin
    lazy: false
    interval: 300
    timeout: 5000
    tolerance: 100
    url: https://www.google.com/gen_204
    include-all: true

  - name: ⚖️ 负载均衡-散列
    type: load-balance
    strategy: consistent-hashing
